import './App.css';
import AddUser from './Components/AddUser';
import AllUser from './Components/AllUser';
import CrudApp from './Components/CrudApp';
import Navbar from './Components/Navbar';
import {BrowserRouter} from ''



function App() {
  return (
    <>
    <BrowserRouter/>
    <Navbar/>
    <CrudApp/>
    <AllUser/>
    <AddUser/>
    </>
  );
}

export default App;
